import { Link } from "react-router-dom"
import { useContext } from "react"
import { contexto } from "./miContexto"


const CartWidget = () => {

  const {cantidad_total} = useContext(contexto)

  return (
    <Link to="/Carrito">
      <span className="material-icons">
        shopping_cart
      </span>
      {cantidad_total}
    </Link>
  )
}
export default CartWidget
